import Expenses from './components/Expenses';

function App() {
  const expenses = [
        {
          id : 'id1',
          expensedate : new Date(2022,9,10),
          count : 'Item 1',
          itemType : 'Food',
          expenditureLocation : 'Hyderabad',
          itemCost : 'Rs:200/-',
        },
        {
          id : 'id2',
          expensedate : new Date(2022,9,9),
          count : 'Item 2',
          itemType : 'Petrol',
          expenditureLocation : 'Kakinada',
          itemCost : 'Rs:500/-',
        },
        {
          id : 'id3',
          expensedate : new Date(2022,9,8),
          count : 'Item 3',
          itemType : 'Movies',
          expenditureLocation : 'Vijayawada',
          itemCost : 'Rs:100/-',
        },
        {
          id : 'id4',
          expensedate : new Date(2022,9,7),
          count : 'Item 4',
          itemType : 'T-shirt',
          expenditureLocation : 'Bangalore',
          itemCost : 'Rs:1000/-',
        }
      ];


  return (
    <div>
      <h2>Let's get started!</h2>
      <Expenses items={expenses} />
    </div>
  );
}

export default App;









